import React from 'react';
import styled from 'styled-components';
import Navbar from '../components/Navbar';
import FilterBar from '../components/FilterBar';
import NextBusCard from '../components/NextBusCard';

const HomeContainer = styled.div`
  padding: 2rem;
  max-width: 800px;
  margin: 0 auto;
  text-align: center;
`;

const Headline = styled.h1`
  font-size: 2.5rem;
  color: #002B5C;
  margin-bottom: 1rem;
`;

const Subheading = styled.p`
  font-size: 1.2rem;
  color: #004b23;
  margin-bottom: 2rem;
`;

const Placeholder = styled.div`
  margin-top: 2rem;
  padding: 1.5rem;
  border: 2px dashed #ccc;
  border-radius: 8px;
  color: #666;
`;

const Home = () => {
  return (
    <div>
      <Navbar />
      <HomeContainer>
        <Headline>CENTRO BUS PREDICTOR</Headline>
        <Subheading>Your campus transit planner</Subheading>
        <FilterBar />
        {/* Placeholder for future results */}
        <Placeholder>
          Real-time predictions will appear here once available.
        </Placeholder>
        {/* Alternatively, you could render <NextBusCard /> here */}
      </HomeContainer>
    </div>
  );
};

export default Home;
